# OEIS sequence: A057854

def A057854(n):
    def f(x):
        if x<=2: return n+2
        a, b, c = 1, 3, 0
        while b<=x:
            a, b = b, a+b
            c += 1
        return n+c+2
    m, k = n, f(n)
    while m != k: m, k = k, f(k)
